/**
 * Stylesheet for the Activity Log page.
 * 
 * Authors: Imran
 */

import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    flatList: {
        width: '100%'
    },
    container: {
        flex: 1,
        paddingTop: 40,
        paddingHorizontal: 20,
        backgroundColor: '#f3ebe1',
    },
    header: {
        color: "#000000",
        textAlign: "center",
        height: 50,
        fontSize: 30,
    },
    topButton: {
        width: 55,
        height: 55
    },
});
